import React, { Component } from 'react'
import './index.css'
import { Input } from 'antd';
// import http from './../../api'

export default class Home extends Component {
    state={
        num:'',
    }
    constructor(props:Object){
        super(props)
    }
    onChange=(e:any)=>{
        console.log(e.target.value)
        this.setState(()=>{
            return {
                num:e.target.value
            }
        })
        // this.setState=({
        //     num:e.target.value
        //  })
    }
   render(){
     return (<div>
      <Input size="large" value={this.state.num} placeholder="请输入歌曲ID" onChange={this.onChange.bind(this)} />
     </div>)
  }
}
